```
// dedup with the sum of the duplicated events
const myCollection = collection<Time>()
    .addEvent(e1)
    .addEvent(e2)
    .addEvent(e3, (events) => {
        const a = events.reduce((sum, e) => sum + e.get("a"), 0);
        return new Event<Time>(t, { a });
    });
```

